        print("     die      ",end="")
    elif line == 65:
        print("      ",end="")
        print(die,end="")
        print("      ",end="")
    else:
        print("              ",end="")
    if devilRndPts >= line and devilRndPts < line+5:
        print(format(devilRndPts,">4d"),"=> ",end="")
    else:
        print("        ",end="")
    print(format(line,">3d"),end="")
    if devilPts >= line and devilPts < line+5:
        print(" <=",format(devilPts,"<4d"),end="")
    else:
        print("        ",end="")
    print()
def printBoard(die,myPts,devilPts,myTurn,myRndPts,devilRndPts):
    # die - Integer valued 1-6.  The rolled die value.
    # myPts - Integer valued 0-100. The current saved score of the human player.
    # devilPts - Integer valued 0-100. The current saved score of the devil.
    # myTurn - Boolean value.  True if it is the human player's turn.
    # myRndPts - Integer valued 0-100.  The human's saved score plus points gained 
that round.
    # devilRndPts - Integer valued 0-100.  The devil's saved score plus points 
gained that round.
    printTitle()
    printYouAndDevil(myTurn)
    printTurnScore()
    for i in range(100,-5,-5):
        printNumberLine(i,die,myPts,devilPts,myTurn,myRndPts,devilRndPts)
    print()

